import React, { useState } from 'react';
import './RentOutBike.css';
import axios from 'axios';
import { useAuth } from './AuthContext';
import { DateRangePicker } from 'react-date-range'; // Import DateRangePicker
import 'react-date-range/dist/styles.css'; // main style file
import 'react-date-range/dist/theme/default.css'; // theme css file

const RentOutBike = ({ navigateTo }) => {
  const [isListingCreated, setListingCreated] = useState(false);
  const [formData, setFormData] = useState({
    vehicleModel: '',
    vehicleDescription: '',
    milesDriven: '',
    pricePerHour: '',
    location: 'Old Boys Hostel',
    availability: {},
    hasFuel: 0,
  });
  const [dateRange, setDateRange] = useState([
    {
      startDate: new Date(),
      endDate: null,
      key: 'selection'
    }
  ]);

  const { isLoggedIn } = useAuth(); // Use the useAuth hook to check if the user is logged in

  const handleInputChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: type === 'checkbox' ? checked : type === 'range' ? value + ' km' : value,
    }));
  };

  const handleSelect = (ranges) => {
    const selectedRange = {
      startDate: ranges.selection.startDate,
      endDate: ranges.selection.endDate,
      key: ranges.selection.key
    };
    setDateRange([selectedRange]);
    setFormData({ ...formData, availability: selectedRange });
  };

  const handleRentOut = async (e) => {
    e.preventDefault();
    if (!isLoggedIn) {
      alert('You must be logged in to rent out a bike');
      return;
    }

    try {
      const response = await axios.post('http://127.0.0.1:5000/rent-out', formData);
      setListingCreated(true);
    } catch (error) {
      console.error('Error renting out the bike:', error);
    }
  };

  return (
    <div className="rent">
      <div className="flex-container1_rob">
        <div className="box-content0_rob">
          <span className="typing-animation1_rob">Rent it Out! </span>
          <br />
          <div className="typing-animation1_rob">
            Make money by renting out your bike when you're not using it.
          </div>
        </div>
      </div>
      <div>
        <form className="toRent" onSubmit={handleRentOut}>
          <label>
            Vehicle Model:
            <input
              type="text"
              name="vehicleModel"
              value={formData.vehicleModel}
              onChange={handleInputChange}
            />
          </label>
          <br />
          <label>
            Vehicle Description:
            <textarea
              name="vehicleDescription"
              value={formData.vehicleDescription}
              onChange={handleInputChange}
            />
          </label>
          <br />
          <label>
            Miles Driven:
            <input
              type="text"
              name="milesDriven"
              value={formData.milesDriven}
              onChange={handleInputChange}
            />
          </label>
          <br />
          <label>
            Price Per Hour:
            <input
              type="text"
              name="pricePerHour"
              value={formData.pricePerHour}
              onChange={handleInputChange}
            />
          </label>
          <br />
          <label>
            Location:
            <select name="location" value={formData.location} onChange={handleInputChange}>
              <option value="Old Boys Hostel">Old Boys Hostel</option>
              <option value="Bakul Nivas">Bakul Nivas</option>
              <option value="Vindhya Canteen">Vindhya Canteen</option>
              <option value="Main Gate">Main Gate</option>
            </select>
          </label>
          <br />
          <label>
            Availability:
            <DateRangePicker
              ranges={dateRange}
              onChange={handleSelect}
            />
          </label>
          <br />
          <label>
            Has Fuel (km left in tank):
            <input
              type="range"
              name="hasFuel"
              min="0"
              max="100"
              value={parseInt(formData.hasFuel)}
              onChange={handleInputChange}
            />
          </label>
          <br />
          <button type="submit">Rent Out</button>
        </form>
        <button onClick={() => navigateTo('landing')}>Go Back</button>
      </div>
      {isListingCreated && (
        <div className="success-message">
          Your bike listing has been created successfully.
        </div>
      )}
    </div>
  );
};

export default RentOutBike;
